import React from "react";

function SkillCard(props) {
  return (
    <>
        <div className="col-md-4 col-sm-12">
          <div className="skills-wrapper__box">
          <h3>{props.title}</h3>

         {props.skills.map(()=>{
          <div>
              <div className="col skills-wrapper__image">
                <img
                  src={require("../images/JavaScript.png")}
                  alt="JavaScript Logo"
                />
                <span>JavaScript</span>
              </div>
              <div className="col skills-wrapper__image">
                <img
                  src={require("../images/JavaScript.png")}
                  alt="JavaScript Logo"
                />
                <span>JavaScript</span>
              </div>
              <div className="col skills-wrapper__image">
                <img src={require("../images/Sass.png")} alt="Sass Logo" />
                <span>Scss/Sass</span>
              </div>
              <div className="col skills-wrapper__image">
                <img
                  src={require("../images/Bootstrap.png")}
                  alt="Bootstrap Logo"
                />
                <span>Bootstrap</span>
              </div>
            </div>
          })} 

          </div>
        </div>
    </>
  );
}

export default SkillCard;
